import { call, put } from 'redux-saga/effects';
import ACTIONS from '../../apiConfig/actions.constants';
import { FOOTPRINTS_API } from '../../apiConfig/api.config';

function* getAssetTypeCount(action) {
  let response;
  try {
    response = yield call(
      window.axios.getData  ,
      FOOTPRINTS_API.GET_ASSE_TYPE_COUNT,
    );

    if (response.status === 200) {
      yield put({
        type: ACTIONS.ASSET_TYPES.ASSETS_COUNT_SUCCESS,
        payload: response.data
      });
      yield put({
        type: ACTIONS.ALERT_MESSAGE.FAIL,
        payload: { ...response.data, ...action.data }
      });
    }else{

    }
  } catch (e) {
    yield put({ type: ACTIONS.ASSET_TYPES.ASSETS_COUNT_FAIL, payload: e });
    yield put({
      type: ACTIONS.ALERT_MESSAGE.FAIL,
      payload: { ...response.data, ...action.data }
    });
  }
}

const dummy =()=> {};

export {getAssetTypeCount, dummy};
